import React, { useEffect, useState } from 'react';
import { Container, Typography, List, ListItem, Alert, CircularProgress } from '@mui/material';
import axiosInstance from '../api/axiosInstance';
import Header from '../components/Header';

const AccessFilesPage = () => {
  const [accessFiles, setAccessFiles] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchAccessFiles = async () => {
      try {
        const response = await axiosInstance.get('/api/current-access-files/');
        setAccessFiles(response.data.access_files);
      } catch (err) {
        setError('Failed to fetch access files.');
      } finally {
        setLoading(false);
      }
    };
    fetchAccessFiles();
  }, []);

  return (
    <>
      <Header />
      <Container maxWidth="md" sx={{ mt: 10 }}>
        <Typography variant="h4" gutterBottom>
          Files You Can Access
        </Typography>

        {loading ? (
          <CircularProgress />
        ) : error ? (
          <Alert severity="error">{error}</Alert>
        ) : (
          <List>
            {accessFiles.map((file) => (
              <ListItem key={file.file__id}>
                <Typography>
                  {file.file__file_name} (Owner: {file.owner__username})
                </Typography>
              </ListItem>
            ))}
          </List>
        )}
      </Container>
    </>
  );
};

export default AccessFilesPage;
